// src/components/EventCard.js
import React from 'react';

const EventCard = ({ title, date, location, description }) => {
  return (
    <div className="event-card">
      <h3>{title}</h3>
      <p>{date} - {location}</p>
      <p>{description}</p>
      <button>Learn More</button>
    </div>
  );
};

export default EventCard;
